import React, { Component } from 'react';
import './Wardrobe.css'

export default class Wardrobe extends Component {
    render() {
        return (
            <div>
                <h1 className="text-warning">WARDROBE</h1>
                <div>
                    <input type="text" id="fname" name="fname"></input>
                </div>
            </div>
        )
    }
}
